import React, { Component } from 'react'
import ReactTable from "react-table";  

export default class Userdaata extends Component {
    constructor(props){
        super(props)
        this.header = [];
        this.state = {}
    }

  render() {
    this.header = [
        { title: "Select", prop: "selectOption" },
        { title: "File name", prop: "fileNames", sortable: true, filterable: true },
        { title: "Plane number", prop: "planeNumber" }
    ];
    return (
      <div className='settings-wrapper'>

      </div>
    )
  }
}
